Vilniaus miesto savivaldybės administracija gavo Jūsų 2021 m. kovo 3 d. prašymą (Savivaldybėje registruota 2021 m. kovo 3 d., reg. Nr. E50-5011/21(3.2.9E-UK9) pateikti informaciją dėl rūkymo prie bendro įėjimo į pastatą.
Lietuvos Respublikos įstatymai, Lietuvos Respublikos Vyriausybės nutarimai, taip pat Savivaldybės tarybos 2018 m. liepos 4 d. sprendimu Nr. 1-1597 patvirtinti biudžetinės įstaigos Vilniaus miesto savivaldybės administracijos nuostatai ir kiti Lietuvos Respublikos teisės aktai nenumato Savivaldybės administracijos įgaliojimų oficialiai aiškinti įstatymus, Savivaldybės tarybos sprendimus, Savivaldybės administracijos direktoriaus įsakymus ir kitus teisės aktus. 
Atsižvelgdami į tai, toliau pateikiame teisinę informaciją, susijusią su Jūsų keliamais klausimais, ir Savivaldybės administracijos specialistų nuomonę, kuri negali būti vertinama kaip oficialus teisės aiškinimas ir kuri nėra privaloma teismams, valstybės ir savivaldybių institucijoms ir įstaigoms, įmonėms, bankams, asociacijoms, kitoms organizacijoms ir asmenims.
Lietuvos Respublikos tabako, tabako gaminių ir su jais susijusių gaminių kontrolės įstatymo (toliau – Įstatymas) 19 straipsnyje nustatyta, kad Lietuvos Respublikoje rūkyti (vartoti tabako gaminius) draudžiama: 
1) visose švietimo, socialinių paslaugų įstaigose, kuriose teikiamos socialinės priežiūros ir (ar) socialinės globos paslaugos vaikams, sveikatos priežiūros įstaigose ir šių įstaigų teritorijose;
2) darbo vietose, esančiose uždarose patalpose. Įmonėse, įstaigose ir organizacijose gali būti įrengtos specialios patalpos (vietos), kuriose leidžiama rūkyti. Rūkymo patalpų (vietų) įrengimo ir eksploatavimo reikalavimus nustato Lietuvos Respublikos Vyriausybė ar jos įgaliota institucija;
3) bendrosios dalinės nuosavybės teise priklausančiose gyvenamosiose patalpose, kitose bendrosios dalinės nuosavybės teisės patalpose ir kitose pastato dalyse;
4) visų rūšių viešajame transporte, išskyrus tolimojo susisiekimo traukinius, kuriuose turi būti numatyti atskiri vagonai nerūkantiesiems ir rūkantiesiems, taip pat orlaivius, kuriuose numatytos atskiros vietos nerūkantiesiems ir rūkantiesiems;
5) restoranuose, kavinėse, baruose, kitose viešojo maitinimo įstaigose, klubuose, diskotekose, interneto kavinėse (interneto klubuose ir pan.), lošimo namuose (kazino), automatų ar bingo salonuose, kitose laisvalaikio praleidimo įstaigose, patalpose, kuriose vyksta sporto varžybos ar kiti renginiai, ir kitose žmonėms aptarnauti skirtose patalpose, išskyrus specialiai įrengtus cigarų ir (ar) pypkių klubus. Cigarų ir (ar) pypkių klubų įrengimo tvarką nustato Lietuvos Respublikos Vyriausybė ar jos įgaliota institucija;
6) transporto priemonių salonuose, jeigu juose yra asmenų iki 18 metų ir (ar) nėščių moterų;
7) dengtose viešojo transporto stotelių vietose (paviljonuose), vaikų žaidimo aikštelėse ir vietose, kuriose teikiamos viešojo maitinimo paslaugos aptarnaujant pirkėjus lauko sąlygomis (prie lauke esančių stalų, pavėsinėse, kituose lauko įrenginiuose), išskyrus rūkymui skirtas vietas;
8) lauke vykstančių sporto varžybų ar kitų lauke vykstančių renginių metu, išskyrus rūkymui skirtas vietas;
9) daugiabučių namų balkonuose, terasose, lodžijose, nuosavybės teise priklausančiose atskiriems savininkams, kai bent vienas namo gyventojas prieštarauja rūkymui.
Įstatymo 19 straipsnio 4 dalyje nustatyta, kad „juridinio asmens valdymo organai privalo užtikrinti, kad juridinio asmens darbuotojai, aptarnaujami klientai ir lankytojai nebūtų priversti kvėpuoti tabako dūmais užterštu oru, taip pat kad matomose vietose būtų iškabinti įspėjamieji užrašai ar ženklai apie draudimą rūkyti, įrengtos specialios rūkymui skirtos patalpos (vietos) ir iškabinti jas nurodantys užrašai ar ženklai“. 
Galiojantys Lietuvos Respublikos įstatymai nenumato draudimo rūkyti lauke ar verslo centrų prieigose. Tačiau, jeigu susiduriate su pasyvaus rūkymo žala Jūsų ar aplinkinių sveikatai, galite pasiūlyti verslo centro savininkui spręsti klausimą dėl atokesnės nuo įėjimo į pastatą rūkymo vietos įrengimo. 
Jei ateityje pastebėsite, kad asmenys galbūt daro pažeidimus, apie tai praneškite policijai skambindami telefonu 112 ar naudodamiesi mobiliąja programėle ePolicija, ar parašydami anonimiškai <a href="https://www.epolicija.lt/web/guest/report-anonymous," target="_blank">https://www.epolicija.lt/web/guest/report-anonymous,</a> ar prisijungę per elektroninius valdžios vartus ir naudodamiesi elektronine paslauga <a href="https://www.epolicija.lt/web/guest/choose-reporting-service-guest" target="_blank">https://www.epolicija.lt/web/guest/choose-reporting-service-guest</a>. Viešosios tvarkos ir visuomenės saugumo užtikrinimas yra pagrindiniai policijos uždaviniai, todėl nenutrūkstamas policijos darbas organizuojamas visą parą.
